import React from 'react';

import styles from './Main.module.css';
import Aux from '../../hoc/Auxillary/Auxillary';

const Main = (props) => (
  <Aux>
    <ul className={styles.Main}>
      <li>project 1</li>
      <li>project 2</li>
      <li>project 3</li>
      <li>project 4</li>
    </ul>
  </Aux>
);

export default Main;
